var Taf   = require("../../../../protal.js");
var MTT  = require("./XXXProxyImp.js").MTT;

var svr = new Taf.server();
svr.initialize(process.env.TAF_CONFIG || "./server.conf", function (server){
    console.log("listening start")
    server.addServant(MTT.XXXProxyImp, server.Application + "." + server.ServerName + ".NodeTafObj");
});

svr.start();